defs.script:
let bank = 0;
let pitch = 0;
let obj = {};
let hdgtext = 0;
let config = {};

window.parent.addEventListener("update", eventHandler, true);

function eventHandler(update) {
  Update(update.detail);
}

var path = window.parent.location.pathname.split('/');
path.pop();
path = path.join("/") + "/";
$.getJSON(path+"/config.json", function(json){
  config = json;
});

window.onload = setTimeout(function(){
  init();
}, 100);

function init(){
  if (config.ias){
    d3.select('#ias-ruler-red_vne-bar')
      .attr('height',1 *12.364)
      .attr('y',373.5-3*1.2364-(config.ias.vne)*12.364)
    if (config.ias.marker.vne) {
      d3.select('#ias-marker-vne').attr('transform','translate(0,'+(config.ias.marker.vne)*-12.364+')')
      d3.select('#ias-marker-vne').attr('style','display:block;')
    }
    d3.select('#ias-marker-x').attr('transform','translate(0,'+(config.ias.marker.x)*-12.364+')')
    if (config.ias.marker.x) {
      d3.select('#ias-marker-x').attr('style','display:block;')
    }
    if (config.ias.marker.y) {
      d3.select('#ias-marker-y').attr('transform','translate(0,'+(config.ias.marker.y)*-12.364+')')
      d3.select('#ias-marker-y').attr('style','display:block;')
    }
    if (config.ias.marker.ge) {
      d3.select('#ias-marker-ge').attr('transform','translate(0,'+(config.ias.marker.ge)*-12.364+')')
      d3.select('#ias-marker-ge').attr('style','display:block;')
    }
    if (config.ias.marker.fe) {
      d3.select('#ias-marker-fe').attr('transform','translate(0,'+(config.ias.marker.fe)*-12.364+')')
      d3.select('#ias-marker-fe').attr('style','display:block;')
    }
    d3.select('#ias-ruler-yellow-bar')
      .attr('height',(config.ias.yellowbarend - config.ias.yellowbarstart) * 12.364)
      .attr('y',(373.74-(config.ias.yellowbarend)*12.364))
    d3.select('#ias-ruler-green-bar')
      .attr('height',(config.ias.greenbarend - config.ias.greenbarstart) *12.364)
      .attr('y',373.5-(config.ias.greenbarend)*12.364)
    d3.select('#ias-ruler-flaps-full-bar')
      .attr('height',(config.ias.whitebarend - config.ias.whitebarstart) *12.364)
      .attr('y',-373.5-(config.ias.whitebarend - config.ias.whitebarstart-config.ias.whitebarend)*12.364)
  }
}

function Update(inputObject){
  obj = inputObject;
  for(let attr = 0; attr < Object.keys(inputObject).length; attr++){
    let key = Object.keys(inputObject)[attr];
    let value = Object.values(inputObject)[attr];
    switch (key) {

      case 'Plane_Bank_Degrees':
        bank = value;
        d3.select('#bank-indicator').attr('transform', 'rotate('+bank+', 500, 373.5)');
        //d3.select('#horizon-gradient').attr('gradientTransform','translate(0 '+pitch+'), rotate('+bank+' 500, 373.5)')
        //d3.select('#pitch-ruler-fade-out-top').attr('gradientTransform','translate(0 '+pitch+'), rotate('+bank+' 500, 373.5)')
        break;

      case 'Plane_Pitch_Degrees':
        pitch = value*-1;
        d3.select('#horizon-gradient').attr('gradientTransform', 'rotate('+bank+', 500, 373.5) translate(0, '+pitch*22.825+')');
        //d3.select('#pitch-ruler-fade-out-top').attr('gradientTransform','translate(0 '+pitch+'), rotate('+bank+' 500, 373.5)')
        d3.select('#pitch-ruler-fade-out-top').attr('gradientTransform','translate(0 '+pitch+'), rotate('+bank+' 500, 373.5)')
        d3.select('#pitch-ruler').attr('transform', 'rotate('+bank+', 500, 373.5) translate(0, '+pitch*22.825+')');
        break;

      case 'Plane_Altitude':
        if (value > 1000) {
            d3.select('#alt-value-thousands').text(Math.floor(value/1000));
            d3.select('#alt-value-hundreds').text(('00' + (Math.floor(Math.round(value))%1000)).slice(-3));
        } else {
            d3.select('#alt-value-thousands').text('');
            d3.select('#alt-value-hundreds').text((Math.floor(value)%1000));
        }
        d3.select('#alt-ruler-complete').attr('transform','translate(0,'+value*1.8545+')')
        break;

      case 'Autopilot_Altitude_Lock_Var':
        d3.select('#ap-alt-value').text(Math.round(value));
        break;

      case 'GPS_Ground_Speed':
        d3.select('#gs-value').text(Math.round(value));
        break;

      case 'Airspeed_Indicated':
        d3.select('#ias-value').text(Math.round(value));
        d3.select('#ias-ruler').attr('transform','translate(0,'+value*12.364+')')
        break;

      case 'KOHLSMAN_SETTING_HG':
        d3.select('#baro-value').text(value.toFixed(2));
        break;

      case 'Plane_Heading_Degrees_True':
        hdgtext = Math.abs(Math.floor(value % 360));
        if (value < 0){
          hdgtext = 360 - Math.abs(Math.floor(hdgtext));
        }
        d3.select('#hdg-value').text(hdgtext);
        d3.select('#hdg-ruler').attr('transform', 'translate('+Math.round(value = 154-value * 15.4)+ ', 300)');
        break;

      case 'INCIDENCE_BETA':
        d3.select('#slip-indicator-ball').attr('transform', 'translate('+Math.round(value)+ ', 0)');
        break;

      case 'test':
        let x = value.x;
        let y = value.y;
        Update({"Plane_Bank_Degrees":(x/-3),"Plane_Pitch_Degrees":(y/-10),"Autopilot_Altitude_Lock_Var":Math.abs(y*x*2), "PLANE_HEADING_DEGREES_TRUE":x, "Airspeed_Indicated": y*1, "PLANE_ALTITUDE":x*y*1, "GPS_GROUND_SPEED":y*-1.04/1.94384, "INCIDENCE_BETA":y/1.5});

        break;

      default:
        //console.log('       :-(    Attribute '+key+' not relevant for this element... Ignoring');
    };
  }
}
